import './App.css';
import Animals from './components/clock';
function App() {
  let people=[

    {name:"daniel",surname:"weeks"},
    {name:"kiki",surname:"talla"},
    {name:"Dani ",surname:"Rixks"},
    {name:"Hella",surname:"thor"},
    {name:"daniel",surname:"weeks"}
  ]
  return (
    <div className="App">

      {people.map(p=>
      <div className="f">
        <h4><Animals name={p.name} surname={p.surname}/></h4>
      </div>
        )}




    </div>
  );
}
export default App;
